import React, { Component } from 'react';
import Form from './Form'

class Header extends Component {
  render() {
    return(
      <div className="header">
      <h1>Who's Time?</h1>
      <Form onSubmit={(e) => {this.props.onSubmit(this.props.buttonInput,e)}}/>
      </div>
      )
  }
}

export default Header
